import React from 'react';
import Projects from '../components/Project';
import '../App.css';
import '../portfolio.css';
const Blog = () => {
  return (
      <React.Fragment>
          <div className='container'>
              <div className='row'>
                  <div className='col'>
                      <div className='card'>
                          <div className='card-body'>
                              <div className="header">
                                  <h3>Portfolio</h3>
                              </div>
                              <div className="modal-footer" />

                              <div className="grid-container vertical-line">
                                  {portfolio.map((project) => (
                                      <ProjectCards
                                          id={project.id}
                                          key={project.id}
                                          image={project.image}
                                          name={project.name}
                                      />
                                  ))}
                              </div>

                          </div>
                      </div>
                  </div>
              </div>
          </div>
      </React.Fragment>
  );
};

export default Blog;
